import React from "react";
import { connect } from "react-redux";
const StreamEdit = () => {
  return <div> StreamEdit</div>;
};

const mapStateToProps = (state, ownProps) => {
  return { stream: state.streams[ownProps.params.id] };
};
export default connect()(StreamEdit);
